import React, { Component } from "react";
import { STUDENT_NAV_MENU } from "../../constants/student-nav-menu";
import { Nav } from "react-bootstrap";
import StudentNavMenuElement from "./StudentNavMenuElement";

export default class StudentNavMenu extends Component {
  constructor(props) {
    super(props);

    this.onSelectHandler = this.onSelectHandler.bind(this);
  }
  onSelectHandler(key) {
    alert("someone clicked");
  }

  render() {
    const elements = STUDENT_NAV_MENU;

    return (
      <Nav
        className="student-nav-menu mr-auto"
        activeKey="1"
        onSelect={(key) => this.onSelectHandler(key)}
        as="ul"
      >
        <Nav.Item eventKey="1" as="li">
          Student
        </Nav.Item>
        <Nav.Item eventKey="2" as="li">
          Teacher
        </Nav.Item>
      </Nav>
    );
  }
}

